import React from "react";
import DeleteIcon from '@material-ui/icons/Delete';

const ToDoList = (props) =>{
 
     
    return(
        <>
        <div className="div">
        <button className="Edit"> E</button>
           <button className="Delete" onClick={() => {
              props.onSelect(props.id);
            }}><DeleteIcon/>
                 </button>
              
       
               {props.text}
       </div>
       
        </>
    );
};

export default ToDoList;
